package org.string.repeatedsubstring;

import org.junit.jupiter.api.Test;
import org.leetcode.string.repeatedsubstring.Main;

import static org.junit.jupiter.api.Assertions.*;

public class RepeatedSubString {
    Main m = new Main();
    @Test void Test1(){
        assertTrue(m.repeatedSubstringPattern("abab"));
    }
    @Test void Test2(){
        assertFalse(m.repeatedSubstringPattern("aba"));
    }
    @Test void Test3(){
        assertTrue(m.repeatedSubstringPattern("abcabcabcabc"));
    }
    @Test void Test4(){
        assertTrue(m.repeatedSubstringPattern(""));
    }
}